OS DEUSES LATINOS E ESLAVOS ERAM IGUAIS E IGUALMENTE REVERENCIADOS NA RUS' DURANTE OS TEMPOS ANTIGOS

O saxão Andreas Schleising visitou Moscou em 1684-1687 e publicou ensaios sobre a Rússia.

"..antes do reinado da princesa Olya ... os Rus, ou moscovitas, estavam completamente imersos no paganismo e adoravam os ídolos de seus falsos deuses, Perun, Stribog, Khors e Mokosh. Além desses quatro ídolos, os moscovitas tinham outros, falsos deuses, como Júpiter, Saturno, Marte, etc.”

